import { useState } from "react";
const CounterOne = (props) => {
  const [count, setCount] = useState(0);
  if (count > 5) {
    console.log("Crashed...!!!");
  }
  return (
    <>
      <button onClick={() => setCount(count + 1)}>{count}</button>
    </>
  );
};

export default CounterOne;
